import styled from 'styled-components';

export const Button = styled.button`
  background-color: #4CAF50;
  border: none;
  color: white;
  padding: 15px 32px;
  font-size: 16px;
  cursor: pointer;
  border-radius: 8px;
  bottom: 20px;
  left: 20px;
  z-index: 1000;
  display: table;
  margin-left:auto;

  &:hover {
    background-color: #45a049;
  }
`;
